#[test]
fn validate_asset_id() {
    let request: super::AuthRequest = super::parse_message(DATA).unwrap();
    // asset is present
    let auth_asset_id = vec!["6129504dafd3924f1cd18087da1e907e4d8813529b489d0883e82de79a6b0bad"];
    match super::validate_asset_id(&request, auth_asset_id) {
        Ok(()) => println!("{}", "Ok"),
        Err(error) => assert!(false),
    };
    // asset is not present
    let auth_asset_id = vec!["12345678afd3924f1cd18087da1e907e4d8813529b489d0883e82de79a6b0bad"];
    match super::validate_asset_id(&request, auth_asset_id) {
        Ok(()) => assert!(false),
        Err(error) => println!("{}", "Ok"),
    };
}

