#[test]
fn validate_outputs() {
    let request: super::AuthRequest = super::parse_message(DATA).unwrap();
    // gaids are present
    let auth_gaid_out = vec!["GA2nbvvbayNahDUB7MBpam5jCnfETJ"];
    let auth_allow_changes: bool = true;
    match super::validate_outputs(&request, auth_gaid_out, auth_allow_changes) {
        Ok(()) => println!("{}", "Ok"),
        Err(error) => assert!(false),
    };
    // change is not present
    let auth_gaid_out = vec!["GA2nbvvbayNahDUB7MBpam5jCnfETJ"];
    let auth_allow_changes: bool = false;
    match super::validate_outputs(&request, auth_gaid_out, auth_allow_changes) {
        Ok(()) => assert!(false),
        Err(error) => println!("{}", "Ok"),
    };
    // gaids are not present
    let auth_gaid_out = vec!["GA2nbvvbayNahDUB7MBpam5jCnfxxx"];
    let auth_allow_changes: bool = true;
    match super::validate_outputs(&request, auth_gaid_out, auth_allow_changes) {
        Ok(()) => assert!(false),
        Err(error) => println!("{}", "Ok"),
    };
}

#[test]
fn validate_amounts() {
    let request: super::AuthRequest = super::parse_message(DATA).unwrap();
    let auth_min_amount: u64 = 1;
    let auth_max_amount: u64 = 2100000000000000;
    // values are in the range
    match super::validate_amounts(&request, auth_min_amount, auth_max_amount) {
        Ok(()) => println!("{}", "Ok"),
        Err(error) => assert!(false),
    };
    // values are under the range
    let auth_min_amount: u64 = 1000;
    match super::validate_amounts(&request, auth_min_amount, auth_max_amount) {
        Ok(()) => assert!(false),
        Err(error) => println!("{}", "Ok"),
    };
    // values are over the range
    let auth_min_amount: u64 = 0;
    let auth_max_amount: u64 = 1;
    match super::validate_amounts(&request, auth_min_amount, auth_max_amount) {
        Ok(()) => assert!(false),
        Err(error) => println!("{}", "Ok"),
    };

}

#[test]
fn main() {
    let client = Client::new(super::rocket()).expect("valid rocket instance");
    let mut response = client.get("/").dispatch();
    assert_eq!(response.body_string(), Some("error".into()));
}

#[test]
fn issuerauthorizer_get() {
    let client = Client::new(super::rocket()).expect("valid rocket instance");
    let mut response = client.get("/issuerauthorizer").dispatch();
    assert_eq!(response.body_string(), Some("error".into()));
}

#[test]
fn issuerauthorizer_post() {
    let client = Client::new(super::rocket()).expect("valid rocket instance");
    let mut response = client.post("/issuerauthorizer").body(DATA).dispatch();
    let result = json!({
        "result": true,
        "error": "",
    });
    assert_eq!(response.body_string(), Some(result.to_string()));
    let mut response = client.post("/issuerauthorizer").body(DATA_INVALID).dispatch();
    let result = json!({
        "result": false,
        "error": "invalid input",
    });
    assert_eq!(response.body_string(), Some(result.to_string()));
    let mut response = client.post("/issuerauthorizer").body(DATA_INVALID_2).dispatch();
    let result = json!({
        "result": false,
        "error": "invalid message",
    });
    assert_eq!(response.body_string(), Some(result.to_string()));
}
